# Imports
import yfinance as yf
import pandas as pd
import numpy as np
from sklearn.svm import SVR
from datetime import datetime, timedelta
from sklearn.model_selection import train_test_split
import matplotlib.pyplot as plt
import csv

def range_predict(ticker=None, prediction_days = 50,start_date = None, end_date=datetime.now(), plot_show=False, file=False, log=False):
    try:
        # Normal start
        plt.style.use('fivethirtyeight')

        # Date variable
        today = datetime.now()
        date = str(today.year) + "-" + str(today.strftime("%m")) + "-" + str(today.strftime("%d"))

        # Getting the data
        if end_date is None:
            end_date = date
        data = yf.download(ticker, start_date, end_date)

        # Define prediction parameters
        original_prediction_days = prediction_days
        final_predictions = pd.DataFrame(index=pd.date_range(start=today, periods=original_prediction_days))
        final_predictions['Price'] = np.nan  # Initialize the 'Price' column with NaN

        # To store accuracy scores for each prediction step
        accuracy_scores = []

        # Function for SVR-based prediction

        def predict_next_day(data):
            if data is None:
                raise ValueError("Data is None")
            
            # Create a future price column for the next day
            data['Future_Price'] = data['Close'].shift(-1)
            
            # Preprocessing
            X = np.array(data['Close']).reshape(-1, 1)[:-1]
            Y = np.array(data['Future_Price'])[:-1]
            
            # Split data
            X_train, X_test, Y_train, Y_test = train_test_split(X, Y, test_size=0.2)
            
            # SVR model
            svr_model = SVR(kernel='rbf', C=1e3, gamma=0.00001)
            svr_model.fit(X_train, Y_train)
            
            # Predict the next day
            future_price = svr_model.predict(X[-1].reshape(1, -1))[0]
            accuracy = svr_model.score(X_test, Y_test)
            return future_price, accuracy

        accuracy_scores = []
        real_data = data.copy()

        # Iterative prediction for each day
        for day in range(1, prediction_days + 1):
            # Predict the next day
            predicted_price, accuracy = predict_next_day(real_data)
            accuracy_scores.append((day, accuracy))
            
            # Add prediction as a new column
            col_name = f"Price"
            final_predictions.loc[final_predictions.index[-1] + timedelta(days=1), col_name] = predicted_price
            
            # Append the prediction to the real data
            next_date = real_data.index[-1] + timedelta(days=1)
            real_data.loc[next_date] = real_data.iloc[-1]  # Duplicate the last row structure
            real_data.loc[next_date, 'Close'] = predicted_price  # Set predicted price as the new 'Close'
            if log:
                print(f"Day {day} prediction: {predicted_price:.2f} | Accuracy: {accuracy*100:.2f}%")

        
        # Accuracy
        if file:
            # Save the final predictions
            final_predictions = final_predictions.dropna()
            # Save final predictions to CSV
            # Save final predictions to CSV
            final_predictions.to_csv("Final_Predictions.csv", index=True, na_rep="NaN")



            with open("Prediction_Accuracy.csv", "w", newline='') as f:
                writer = csv.writer(f)
                writer.writerow(["Day", "Accuracy"])
                for day, acc in accuracy_scores:
                    writer.writerow([day, f"{acc*100:.2f}%"])
        # Plotting final predictions
        plt.figure(figsize=(12, 4))
        plt.plot(final_predictions.index, final_predictions['Price'], label='Predicted Prices', lw=2, alpha=0.7)
        plt.xticks(rotation=45)
        plt.legend()
        if plot_show:
            plt.show()
        json_data = final_predictions.to_json(orient='index', date_format='iso')
        return json_data
    except:
        return "Error"
    






def short_predict(ticker=None, prediction_days = 5,start_date = None, end_date=datetime.now(), file=False):
    try:
        #Normal start
        plt.style.use('fivethirtyeight')

        #Date varible
        today = datetime.now()
        date = str(today.year) + "-" + str(today.strftime("%m")) +  "-" +  str(today.strftime("%d"))

        #Getting the data
        data = yf.download(ticker, start_date, end_date)

        # Create a new column for the future prices
        futuredays = 3
        data['Future_Price'] = data['Close'].shift(-futuredays)

        # Preprocessing the data
        X = np.array(data['Close']).reshape(-1, 1)
        X = X[:-futuredays]
        Y = np.array(data['Future_Price'])[:-futuredays]

        # Splitting the data into training and testing sets
        X_train, X_test, Y_train, Y_test = train_test_split(X, Y, test_size=0.2)

        # Creating an instance of the SVR model with the "rbf" kernel and training it on the training data
        svr_rdf = SVR(kernel='rbf', C=1e3, gamma=0.00001)
        svr_rdf.fit(X_train, Y_train)

        # Making predictions on the future prices
        future_prices = svr_rdf.predict(X[-futuredays:].reshape(-1, 1))



        #  for the testing data
        svm_prediction = svr_rdf.predict(X_test)

        if file:
            # Calculating the accuracy of the prediction
            accuracy = svr_rdf.score(X_test, Y_test)
            print(f"Accuracy: {accuracy*100:.2f}%")

            # Saving the accuracy score to a file
            with open("AAPL-score.txt", "w") as f:
                f.write(f"Accuracy: {accuracy*100:.2f}%\n")
            # Saving the predicted prices into a file
            with open("AAPL.txt", "w") as f:
                for i, price in enumerate(future_prices):
                    if i == 0:
                        day = "Today"
                    elif i == 1:
                        day = "Tomorrow"
                    else:
                        day = f"{i} days later"
                    f.write(f"{day}: {price:.2f} dollars\n")

        print(future_prices)
        return future_prices
    except:
        return "Error"
    

